import React from 'react'
import { useNavigate } from 'react-router-dom';

const FeatureList = () => {
    const navigate = useNavigate();
  return (
    <div class="bg-green-600">
    <h1 class="pt-full text-4xl font-sans text-center text-white font-bold my-auto">
      Employee Manager
    </h1>
    <div>
      <button className="text-white bg-green-600 hover:bg-green-800 rounded px-4 py-2 mx-auto block">
        Employee List
      </button>
      <button
        className="text-white bg-green-600 hover:bg-green-800 rounded px-4 py-2 mx-auto block"
        onClick={() => navigate("/addEmployee")}
      >
        Add Employee
      </button>
    </div>
    </div>
  );
}

export default FeatureList;
